import React from 'react';
import { Header, Icon, Player, Embed } from 'semantic-ui-react';
import Vikings from '../Video/Vikings.mp4';
import Got from '../Video/got.mp4';


const HeaderPart = () => {
    return (
        <React.Fragment>
            <div>
                {/* <video
                    autoPlay
                    loop
                    muted
                    style={{
                        position: "absolute",
                        width: "100%",
                        objectFit: "cover",
                        transform: "translate(-50%,-10%)"
                    }}
                >
                    <source src={Vikings} type="video/mp4" />
                </video> */}
            </div>
            <div class="features ui grid noMargin" style="overflow-y:auto;white-space:nowrap;">
                <div class="four wide column greyOdd">Stuff here</div>
                <div class="four wide column greyEven">More stuff</div>
                <div class="four wide column greyOdd">Calls n stuff</div>
                <div class="four wide column greyEven">Testing look</div>
                <div class="four wide column greyOdd">Stuff here</div>
                <div class="four wide column greyEven">More stuff</div>
                <div class="four wide column greyOdd">Calls n stuff</div>
                <div class="four wide column greyEven">Testing look</div>
            </div>

            <div>dsfsdfsdfsd</div>
        </React.Fragment>
    )
}

export default HeaderPart;
